// Hey!!! Javascript uses 0 start indexing, not 1 start!!! Don't mess it up!!!


function sqr(x) { return x*x}  // Saves a lot of runtime vs Math.pow


var focal_point = col_row_names[0]




function focused_mds(m, focus) {
	
	var cos = Math.cos
	
	var sin = Math.sin
	
	// call distances for focal_point
	var dists = dis[col_row_names.indexOf(focal_point)];
	
	// zip together in an array of arrays the names and distances
	var names_dists = col_row_names.map(function(e,i){
		return [e, dists[i]];
	});
	
	// sort the array by the distances
	names_dists.sort(function(a,b)
	{
		return a[1] - b[1];
	});
	
	// array of names, ordered by distance to focus
	var obj_by_dist = names_dists.map(function(names_dists){
		return names_dists[0]
	});
	
	// array of r distances to focus, ordered by distance to focus
	var rs = names_dists.map(function(names_dists){
		return names_dists[1]
	});
	
	var phis = [0, Math.PI/2 ];
	
	var xcoords = [0,  rs[1] * cos(phis[1]) ];

	var ycoords = [0,  rs[1] * sin(phis[1]) ];
	
	var new_point = 2;
	
	function stress(phi) {
		var stress = 0;
		var j = 0;       //the iteration variable
	
		//position of the new point, given the candidate phi
		var xnew = rs[new_point] * cos(phi);
		var ynew = rs[new_point] * sin(phi);
	
		while (j < new_point ) {
			//position of the point we are comparing to new point
			var xj = xcoords[j];
			var yj = ycoords[j];
		
			//index of column names of matrix, in ORIGINAL order
			var dij_col = col_row_names.indexOf(obj_by_dist[new_point]);
			var dij_row = col_row_names.indexOf(obj_by_dist[j]);
		
			// actual distance given by dis matrix
			var dij = dis[dij_col][dij_row];
			
			// calculated distance, given where we placed the point
			var Dij = Math.sqrt( sqr((xnew - xj)) + sqr((ynew - yj)) );
		
			var stress = stress + sqr( (dij - Dij));
		
			var j = j + 1;
		}
		return stress;
	}
	
	while (new_point < obj_by_dist.length) {
		var stress_res = optimize_js(0, 2*Math.PI, stress, 0.001);
		
		phis.push(stress_res);
		xcoords.push( rs[new_point] * cos(phis[new_point]) );
		ycoords.push( rs[new_point] * sin(phis[new_point]) );
		
		new_point = new_point + 1;	
	}
	
	var result = {
		obj_by_dist: obj_by_dist,
		rs: rs,
		phis: phis,
		xcoords: xcoords,
		ycoords: ycoords
	};
	
	
	return result;
}
